Zoología Especial. - Aves - Taxonomía y sistemática. [Las divisiones de las Aves son las siguientes, en orden alfabéticamente :-Accipitres; Aipyornithes; Alc ; 
Alectorides (incluyendo Cariama); Anseres (incluyendo Phcenicopteri y Palamediids); Apteryges ; Caprimulgi; Casuarii; Coccyges; Volumbe ; Coracise; 
Cryptnci; Cypseli ; Dinornithes; Fulicariss; Galline; Gavie ; Herodiones ; Heterodactyle ; Impennes; Limicole ; Odontolc Odontorme ; Opie ocomii ; 
Passeres; Pici; Peittaci; Pterocletes; Pygopodes; Rhee ; Saurune; Steganopodes ; Stereornithes; Striges; Struthiones: 'Tubinares; Zygodactyle].
